INSERT INTO public.classifications (id, value, title, image, description, source_external_id, created_at, updated_at, type_id, source_id, parent_id) VALUES (268, 'porosus', 'Crocodylus porosus', 'https://upload.wikimedia.org/wikipedia/commons/thumb/4/43/SaltwaterCrocodile%28%27Maximo%27%29.jpg/320px-SaltwaterCrocodile%28%27Maximo%27%29.jpg', 'The saltwater crocodile is a crocodilian native to saltwater habitats and brackish wetlands from India''s east coast across Southeast Asia and the Sundaic region to northern Australia and Micronesia.', 8560, '2020-05-23 11:24:07.322720', '2020-05-23 11:24:07.322720', 8, 1, 267);
