INSERT INTO public.classifications (id, value, title, image, description, source_external_id, created_at, updated_at, type_id, source_id, parent_id) VALUES (275, 'tigris', 'Panthera tigris', 'https://upload.wikimedia.org/wikipedia/commons/thumb/b/b0/Bengal_tiger_%28Panthera_tigris_tigris%29_female_3_crop.jpg/320px-Bengal_tiger_%28Panthera_tigris_tigris%29_female_3_crop.jpg', 'The tiger is the largest extant cat species. It is most recognisable for its dark vertical stripes on orange-brown fur with a lighter underside. It is an apex predator, primarily preying on ungulates such as deer and wild boar.', 6047, '2020-05-23 11:24:09.574341', '2020-05-23 11:24:09.574341', 8, 1, 274);
