INSERT INTO public.classifications (id, value, title, image, description, source_external_id, created_at, updated_at, type_id, source_id, parent_id) VALUES (282, 'attenuata', 'Stenella attenuata', 'https://upload.wikimedia.org/wikipedia/commons/thumb/0/02/Schlankdelfin.jpg/320px-Schlankdelfin.jpg', 'The pantropical spotted dolphin is a species of dolphin found in all the world''s temperate and tropical oceans. The species was beginning to come under threat due to the killing of millions of individuals in tuna purse seines.', 8989, '2020-05-23 11:24:12.620247', '2020-05-23 11:24:12.620247', 8, 1, 281);
