INSERT INTO public.classifications (id, value, title, image, description, source_external_id, created_at, updated_at, type_id, source_id, parent_id) VALUES (303, 'obscurus', 'Trachypithecus obscurus', 'https://upload.wikimedia.org/wikipedia/commons/thumb/e/e2/Dusky_leaf_monkey_%288050982300%29.jpg/360px-Dusky_leaf_monkey_%288050982300%29.jpg', 'The dusky leaf monkey, spectacled langur, or spectacled leaf monkey is a species of primate in the family Cercopithecidae. It is found in Malaysia and Thailand', 10564, '2020-05-23 11:24:18.841160', '2020-05-23 11:24:18.841160', 8, 1, 106);
