INSERT INTO public.classifications (id, value, title, image, description, source_external_id, created_at, updated_at, type_id, source_id, parent_id) VALUES (324, 'alcinus', 'Macheiramphus alcinus', 'https://upload.wikimedia.org/wikipedia/commons/thumb/f/f4/MacheiramphusAlcinus.jpg/595px-MacheiramphusAlcinus.jpg', 'The bat hawk is a raptor found in sub-Saharan Africa and south Asia to New Guinea. It is named for its diet, which consists mainly of bats. It requires open space in which to hunt, but will live anywhere from dense rainforest to semi-arid veld.', 7027, '2020-05-23 11:24:26.446214', '2020-05-23 11:24:26.446214', 8, 1, 323);
