INSERT INTO public.classifications (id, value, title, image, description, source_external_id, created_at, updated_at, type_id, source_id, parent_id) VALUES (338, 'coeruleoalba', 'Stenella coeruleoalba', 'https://upload.wikimedia.org/wikipedia/commons/e/e6/Stenella_coeruleoalba.jpg', 'The striped dolphin has a similar size and shape to several other dolphins that inhabit the waters it does (see pantropical spotted dolphin, Atlantic spotted dolphin, Clymene dolphin). However, its colouring is very different and makes it relatively easy to notice at sea. The underside is blue, white, or pink.', 10064, '2020-05-23 11:24:32.245345', '2020-05-23 11:24:32.245345', 8, 1, 281);
